export enum InvestimentoTypes {
 'GET_INVESTIMENTOS_SUCCESS' = '@todo/GET_INVESTIMENTOS_SUCCESS',
    'GET_INVESTIMENTOS_REQUEST' = '@todo/GET_INVESTIMENTOS_REQUEST',
    'ADD_INVESTIMENTO_REQUEST' = '@todo/ADD_INVESTIMENTO_SUCCESS',
    'ADD_INVESTIMENTO_SUCCESS' = '@todo/ADD_INVESTIMENTO_SUCCESS',
  }

  export interface InvestimentoData {
        _id: string,
        opcao: string,
        valor: number,
        data: string
    }

  export interface InvestimentoState {
    investimentos: InvestimentoData[]
  }
